(9, 1, 'Guided Inquiry', 'You give students an open question. Typically in groups, they design investigation methods to reach a conclusion.', 1, '2021-11-02 02:46:43', '2021-11-02 14:46:43', 1, 1, 1),
(10, 1, 'Open Inquiry', 'You give students time and support. They pose original questions that they investigate through their own methods, and eventually present their results to discuss and expand.', 1, '2021-11-02 02:46:43', '2021-11-02 14:46:43', 1, 1, 1),
(11, 2, 'General complaint', 'A student may submit a complaint regarding staff, faculty, or other student. Complainant must submit their concern via the preliminary complaint form.', 1, '2021-11-02 02:46:43', '2021-11-02 14:46:43', 1, 1, 1),
(12, 2, 'ADA grievance', 'ADA grievance', 1, '2021-11-02 02:46:43', '2021-11-02 14:46:43', 1, 1, 1),
(13, 2, 'Academic Misconduct', 'A student should be informed of any academic misconduct allegation by their instructor.', 1, '2021-11-02 02:46:43', '2021-11-02 14:46:43', 1, 1, 1),
(14, 2, 'Sexual Assault', 'Sexual harassment is a serious problem for students at all educational levels.', 1, '2021-11-02 02:46:43', '2021-11-02 14:46:43', 1, 1, 1),
(15, 2, 'Interpersonal Violence', 'Domestic and Interpersonal Violence', 1, '2021-11-02 02:46:43', '2021-11-02 14:46:43', 1, 1, 1),
(16, 2, 'Sexual Harassment', 'Sexual Harassment, and Other Discrimination', 1, '2021-11-02 02:46:43', '2021-11-02 14:46:43', 1, 1, 1),
(17, 2, 'Student conduct', 'A student may only appeal a capricious grade, or student conduct expulsion or suspension.', 1, '2021-11-02 02:46:43', '2021-11-02 14:46:43', 1, 1, 1),
(18, 4, 'Teacher', 'Reference by teacher', 1, '2021-11-02 02:46:43', '2021-11-02 14:46:43', 1, 1, 1),
(19, 4, 'Student', 'Student', 1, '2021-11-02 02:46:43', '2021-11-02 14:46:43', 1, 1, 1),
(20, 4, 'Institution Committee', 'Institution Committee', 1, '2021-11-02 02:46:43', '2021-11-02 14:46:43', 1, 1, 1);
